export default function About() {
  return (
    <div className='about-container'>
			<div className="section-1">
				<h4> About </h4>
				<p> I grew up in New York and Iowa, but for the last 5 years, I've been living and working in Vietnam. I graduated with a degree in biomedical engineering but have since worked as a science and English teacher.</p>
			</div>
			<div className="section-2">
				<h4> Interests </h4>
				<p> My favorite hobby is cycling, and I love to ride around the countryside of rural Vietnam. I also enjoy coding, hanging out with my son, and trying new foods.</p>
			</div>
    </div>
  );
}
